import React from 'react';

const About = ({  }) => {
  const header = `A LITTLE BIT ABOUT ME`;
  const introduction = `Hey! My name is Steven and I'm a web developer with a passion for front end development and design. I aspire toward a career that will allow me to channel my creativity through crafting beautiful software and engaging experiences.`
  return (
    <div>
      <h1>{header}</h1>
      {/* <img src="src/components/profile.jpg"/> */}
      <p>Hey! My name is Steven and I'm a web developer with a passion for front end development and design. I aspire toward a career that will allow me to channel my creativity through crafting beautiful software and engaging experiences.</p>
      <p>When I am not on the computer, I enjoy hiking, basketball and just being out in nature. </p>
    </div>
  )
}

export default About;
